description:
Created by Zomba Music Publishing, the actual title of the album &quot;Since I Left You&quot; is not stated anywhere, but is only referred to as &quot;The Album&quot;.

Contains even more samples than the original Australian retail version (MODCD009), all of which were intended to be included on the album but were removed for legal reasons prior to its official release.

This also features &quot;With My Baby&quot; which was not included on the final version of the album, but was used as a B-Side for &quot;Frontier Psychiatrist&quot;
